import React, { useState, useEffect } from "react";

export default function SettingsForm() {
    const user = JSON.parse(localStorage.getItem("user"));
    const userID = user.user_id || localStorage.getItem('userId');
    const [surveyData, setSurveyData] = useState({});
    console.log("userID in SettingsForm.js ", userID);
    console.log("User in SettingsForm.js: ", user);

    useEffect(() => {
        const fetchSurveyData = async () => {
            try {
                const response = await fetch(`http://localhost:3001/surveyfetch/${userID}`);
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                const data = await response.json();
                console.log("Data from DB: ",data.surveyData);
                setSurveyData(data.surveyData[0]);
            } catch (error) {
                console.error('Error fetching survey data:', error);
            }
        };

        if (userID) {
            fetchSurveyData();
        }
    }, [userID]);

    const handleDeleteAccount = () => {
        // Logic to show confirmation modal for account deletion.
    };

    return (
        <div className="container mt-3">
            <div className="row">
                <div className="col-md-9 py-4">
                    <form>
                        <div className="mb-3">
                            <label className="form-label">*First Name:</label>
                            <input type="text" className="form-control-plaintext" readOnly value={user.first_name} />
                        </div>
                        <div className="form-field">
                            <label>*Last Name: 
                            <span>{user.last_name}</span>
                            </label>

                        </div>
                        <div className="form-field">
                            <label>*Email: 
                            <span>{user.email}</span>
                            </label>
                        </div>
                        <div className="form-field">
                            <label>*PASSWORD: 
                            <span>{user.password}</span>
                            </label>
                        </div>
                        <div className="form-field">
                            <label>Phone: 
                            <span>{user.phone_number}</span>
                            </label>
                        </div>
                        <div className="form-field">
                            <label>Role:
                            <span>{user.role}</span>
                            </label>
                        </div>
                        <div className="form-field">
                            <label>Fitness Level: 
                            <span>{surveyData.fitness_level}</span>
                            </label>
                        </div>
                        <div className="form-field">
                            <label>Diet Level: 
                            <span>{surveyData.diet}</span>
                            </label>
                        </div>
                        <div className="form-field">
                            <label>Weekly Exercise: 
                            <span>{surveyData.weekly_exercise}</span>
                            </label>
                        </div>
                        <div className="form-field">
                            <label>Goal: 
                            <span>{surveyData.goal_id}</span>
                            </label>
                        </div>
                        <button onClick={handleDeleteAccount}>Delete Account</button>
                    </form>
                </div>
            </div>
        </div>
    );
}
